import '../Styling/App.css';
import React, {useState, useEffect, useRef} from 'react';
import {Route, Routes} from 'react-router-dom';

import Splash from './Splash';
import Login from './Login';
import NotFound from './NotFound';
import AppInfo from './AppInfo';

export default function App() {

    return (
        <div className='appContainer'>
            <svg className='splash-background'
                viewBox='0 0 100 100'
                style={{
                    position: 'absolute',
                    left: 0,
                    top: 0,
                    width: "100%",
                    height:"100%",
                    zIndex: 3
                }}
            >
                <path d='M434-22.68l11,837.36H-269s415-163,445-448S44-22.68,44-22.68Z' 
                    id='splash-background-path1'
                    transform='translate(-14, -40), scale(.3)'
                />
                <path d="M244.33-97.52s444,322.52,0,947.85H479s96-715.17-26.67-956.25Z" 
                    id='splash-background-path2'
                    transform='translate(-40, -50), scale(.4)'
                />
            </svg> 
            <div >
                <Routes>
                    <Route path='/' element={<Splash />} />
                    <Route path='/Login' element={<Login />}/>
                    <Route path='*' element={<NotFound />}/>
                </Routes>
                <AppInfo />
            </div>
        </div>
    )
}
